import React, { Component } from "react";

class SignUp extends Component {
  state = {
    email: null,
    display_name: null,
    age: null,
    gender: null,
    looking_for: null,
    zip_code: null
  }

  render() {
    return (
      <form className="ui item">
        <label>Email</label>
        <input name="email" type="text" value={this.state.email} onChange={this.handleChange}></input>
      </form>
    );
  }
}

export default SignUp;
